Libc is a common C standard library that has been in use for a long time. It has been implemented for very many operating systems. Rust is a new language. It is very hard to implement the rust_std for all operating systems. To save on labour and allow compatibility, Rust creators decided to make the Rust Library to use libC functions instead of recreating the functions in pure Rust. Though there are some parts of the Rust std library that do not depend on libc. Now that it is clear that rust_std depends on libc, when a rust bin is executed, the following events happen. The executable program is stored in the main memory (eg RAM) The CPU points to the first instruction of the executable (the entry point). In this case, the entry point is the _start function found in the C runtime. The C runtime sets up its environment in preparation for the libc functions that will get called by the rust_std functions After the C runtime has set up the execution environment for the libc functions, it points to the entry point of the Rust Runtime. The entry point of the Rust Runtime is marked with a language item called "start" ie [start] So the Rust runtime creates an executable environment for executing the Rust functions. After the Rust runtime has finished setting up things, it looks for the "main" function. Main starts executing Our bare metal program does not depend on the C runtime. So this sequence of events is quite irrelevant to us. What we will do is that we will inform the compiler that we wont follow this sequence by : Adding the #![no_main] crate attribute to our project. Declaring our own entry point function To declare our own entry point, we will export a function out of the crate... like so : #[no_mangle] // The no_mangle attribute explained below
pub extern "C" fn _start() // Mangling is a technique used by compilers to encode the names of // functions, methods, and other symbols in a program in a way that includes additional information beyond just the name itself. // For example `main` may become `main21212jxbjbjbkjckbdsc&kbjbjksdbdjkbf`
// The primary purpose of mangling is to make sure that each variable or function is completely unique to
// the point that there are no name-conflicts during compilation and linking. // This also enables function overloading //In Rust, the #[no_mangle] attribute is used to instruct the compiler not to mangle the name of the item ...
// (function or static variable) during compilation. This is useful when you want to interface with external
// code, like C code or assembly code, where the function names need to remain unchanged. // We want "_start" to be referenced as it is. We cannot gamble with the identity such a symbol name But that is not enough, we need to tell the linker the name of our entry_point function. We do this by writing a linker script that uses the ENTRY command. The linker will place the code as the first part of the .text section and update the elf header sections to reflect this info. ...
OUTPUT_ARCH( "riscv" ) ENTRY( _start ) /* See? we have used the name `_start` just like it is. If name mangling had happened, we would have had some random name that changes with every compilation. MEMORY
{ ram : ORIGIN = 0x80000000, LENGTH = 128M
}

